		Stack<SlaveInterface> slaves = slave;

		for (RemoteClientInterface free_client : clients) {
			if (slaves.size() > 0) {
				
				// Need to match clients and slaves
				slaves.peek().setClient(free_client);

				// pop from slave
				slaves.pop();

				// pop from client
				clients.pop();
				
				

			}
		}

	}
