	@Override
	public void match(Stack<Thread> unassigned_slaves, Stack<RemoteClientInterface> client) throws RemoteException {
		Stack<RemoteClientInterface> clients = client;
		Stack<Thread> slaves = unassigned_slaves;

		for (RemoteClientInterface free_client : clients) {
			if (slaves.size() > 0) {
				
				// Need to match clients and slaves
				String name = slaves.peek().getName();
				Integer key = Character.getNumericValue(name.charAt(name.length() - 1));
				slaveClientMap.put(key, free_client);

				// pop from slave
				slaves.pop();

				// pop from client
				clients.pop();
				
				

			}
		}

	}
